    return data

def tnary_tree_print(node, level):
    if node is None:
        return
    for i in range(level):
        print("| ", end="")
    print(node.data)
    for child in node.children:
        tnary_tree_print(child, level + 1)

class MapNode:
    def __init__(self, data):
        self.data = data
        self.next = None

class Map:
    def __init__(self):
        self.key = None
        self.count = 0
        self.value = [None] * 128

def map_hash(string):
    hash_val = 5381
    for char in string:
        hash_val = ((hash_val << 5) + hash_val) + ord(char)
    return hash_val % 128

def map_set(map, key, new_node):
    hash_val = map_hash(key)
    node = map.value[hash_val]
    if node is None:
        map.value[hash_val] = new_node
        map.count += 1
        return True
    while node.next is not None:
        node = node.next
    node.next = new_node
    map.count += 1
    return True

def map_get(map, key):
    hash_val = map_hash(key)
    node = map.value[hash_val]
    while node is not None:
        if node.data == key:
            return node
        node = node.next
    return None

def map_clear(map):
    for i in range(128):
        node = map.value[i]
        while node is not None:
            temp = node
            node = node.next
            del temp
    del map

