// –ü–∞—Ä–∞–º–µ—Ç—Ä—ã PID —Ä–µ–≥—É–ª—è—Ç–æ—Ä–∞
float Kp = 1.0f; // –ü—Ä–æ–ø–æ—Ä—Ü–∏–æ–Ω–∞–ª—å–Ω—ã–π –∫–æ—ç—Ñ—Ñ–∏—Ü–∏–µ–Ω—Ç
float Ki = 0.1f; // –ò–Ω—Ç–µ–≥—Ä–∞–ª—å–Ω—ã–π –∫–æ—ç—Ñ—Ñ–∏—Ü–∏–µ–Ω—Ç
float Kd = 0.05f; // –î–∏—Ñ—Ñ–µ—Ä–µ–Ω—Ü–∏–∞–ª—å–Ω—ã–π –∫–æ—ç—Ñ—Ñ–∏—Ü–∏–µ–Ω—Ç

// –ü–µ—Ä–µ–º–µ–Ω–Ω—ã–µ –¥–ª—è —Ö—Ä–∞–Ω–µ–Ω–∏—è –∑–Ω–∞—á–µ–Ω–∏–π
float setpoint = 25.0f; // –ñ–µ–ª–∞–µ–º–∞—è —Ç–µ–º–ø–µ—Ä–∞—Ç—É—Ä–∞
float current_temperature; // –¢–µ–∫—É—â–∞—è —Ç–µ–º–ø–µ—Ä–∞—Ç—É—Ä–∞
float integral = 0.0f; // –ò–Ω—Ç–µ–≥—Ä–∞–ª—å–Ω–∞—è —Å—É–º–º–∞
float previous_error = 0.0f; // –ü—Ä–µ–¥—ã–¥—É—â–∞—è –æ—à–∏–±–∫–∞

// –§—É–Ω–∫—Ü–∏—è –¥–ª—è —á—Ç–µ–Ω–∏—è —Ç–µ–∫—É—â–µ–π —Ç–µ–º–ø–µ—Ä–∞—Ç—É—Ä—ã
float read_temperature() {
    // –ó–¥–µ—Å—å –¥–æ–ª–∂–µ–Ω –±—ã—Ç—å –∫–æ–¥ –¥–ª—è –ø–æ–ª—É—á–µ–Ω–∏—è —Ç–µ–º–ø–µ—Ä–∞—Ç—É—Ä—ã –æ—Ç –¥–∞—Ç—á–∏–∫–∞
    return 0.0f; // –í—Ä–µ–º–µ–Ω–Ω–æ–µ –∑–Ω–∞—á–µ–Ω–∏–µ
}

// –§—É–Ω–∫—Ü–∏—è –¥–ª—è —É–ø—Ä–∞–≤–ª–µ–Ω–∏—è –æ—Ö–ª–∞–∂–¥–µ–Ω–∏–µ–º
void control_cooling(float output) {
    // –ó–¥–µ—Å—å –¥–æ–ª–∂–µ–Ω –±—ã—Ç—å –∫–æ–¥ –¥–ª—è —É–ø—Ä–∞–≤–ª–µ–Ω–∏—è –º–æ—â–Ω–æ—Å—Ç—å—é –æ—Ö–ª–∞–∂–¥–µ–Ω–∏—è
}

void pid_task(void *pvParameters) {
    while(1) {
        current_temperature = read_temperature();
        float error = setpoint - current_temperature;
        integral += error * 0.1f; // –ò–Ω—Ç–µ–≥—Ä–∏—Ä–æ–≤–∞–Ω–∏–µ —Å —É—á–µ—Ç–æ–º –≤—Ä–µ–º–µ–Ω–∏ (dt)
        float derivative = (error - previous_error) / 0.1f; // –î–∏—Ñ—Ñ–µ—Ä–µ–Ω—Ü–∏—Ä–æ–≤–∞–Ω–∏–µ
        float output = Kp * error + Ki * integral + Kd * derivative;
        control_cooling(output);
        previous_error = error;
        vTaskDelay(100 / portTICK_PERIOD_MS); // –ó–∞–¥–µ—Ä–∂–∫–∞ 100 –º—Å
    }
}

void app_main() {
    xTaskCreate(&pid_task, "pid_task", 2048, NULL, 5, NULL);
}

