–î–ª—è –∏–Ω—Ç–µ–≥—Ä–∞—Ü–∏–∏ –®–ò–ú (—à–∏—Ä–æ—Ç–Ω–æ-–∏–º–ø—É–ª—å—Å–Ω–æ–π –º–æ–¥—É–ª—è—Ü–∏–∏) —Å —Ä–∞–∑—Ä–µ—à–µ–Ω–∏–µ–º 4095 –∏ –æ–≥—Ä–∞–Ω–∏—á–µ–Ω–∏—è –º–∞–∫—Å–∏–º–∞–ª—å–Ω–æ–≥–æ –∏–Ω—Ç–µ–≥—Ä–∞–ª—å–Ω–æ–≥–æ –∑–Ω–∞—á–µ–Ω–∏—è (i_max) –≤ –≤–∞—à PID —Ä–µ–≥—É–ª—è—Ç–æ—Ä, –≤—ã –º–æ–∂–µ—Ç–µ –∏—Å–ø–æ–ª—å–∑–æ–≤–∞—Ç—å —Å–ª–µ–¥—É—é—â–∏–π –∫–æ–¥:
–≠—Ç–æ—Ç –∫–æ–¥ –≤–∫–ª—é—á–∞–µ—Ç –Ω–∞—Å—Ç—Ä–æ–π–∫—É –®–ò–ú —Å –∏—Å–ø–æ–ª—å–∑–æ–≤–∞–Ω–∏–µ–º ESP-IDF SDK –∏ —Ñ—É–Ω–∫—Ü–∏—é –æ–≥—Ä–∞–Ω–∏—á–µ–Ω–∏—è –º–∞–∫—Å–∏–º–∞–ª—å–Ω–æ–≥–æ –∑–Ω–∞—á–µ–Ω–∏—è –∏–Ω—Ç–µ–≥—Ä–∞–ª—å–Ω–æ–π —Å–æ—Å—Ç–∞–≤–ª—è—é—â–µ–π. –ü–æ–∂–∞–ª—É–π—Å—Ç–∞, —É–±–µ–¥–∏—Ç–µ—Å—å, —á—Ç–æ –≤—ã –Ω–∞—Å—Ç—Ä–æ–∏–ª–∏ GPIO –∏ –¥—Ä—É–≥–∏–µ –ø–∞—Ä–∞–º–µ—Ç—Ä—ã –≤ —Å–æ–æ—Ç–≤–µ—Ç—Å—Ç–≤–∏–∏ —Å –≤–∞—à–µ–π –∞–ø–ø–∞—Ä–∞—Ç–Ω–æ–π –∫–æ–Ω—Ñ–∏–≥—É—Ä–∞—Ü–∏–µ–π. –£–¥–∞—á–∏ –≤ —Ä–µ–∞–ª–∏–∑–∞—Ü–∏–∏ –≤–∞—à–µ–≥–æ –ø—Ä–æ–µ–∫—Ç–∞!
–î–∞, –ø—Ä–µ–¥–æ—Å—Ç–∞–≤–ª–µ–Ω–Ω—ã–π –∫–æ–¥ –ø—Ä–µ–¥–Ω–∞–∑–Ω–∞—á–µ–Ω –¥–ª—è —Å–∏—Å—Ç–µ–º—ã –æ—Ö–ª–∞–∂–¥–µ–Ω–∏—è –Ω–∞ –±–∞–∑–µ ESP32. –û–Ω –∏—Å–ø–æ–ª—å–∑—É–µ—Ç PID —Ä–µ–≥—É–ª—è—Ç–æ—Ä –¥–ª—è –∫–æ–Ω—Ç—Ä–æ–ª—è —Ç–µ–º–ø–µ—Ä–∞—Ç—É—Ä—ã, –ø–æ–¥–¥–µ—Ä–∂–∏–≤–∞—è –µ—ë –Ω–∞ –∑–∞–¥–∞–Ω–Ω–æ–º —É—Ä–æ–≤–Ω–µ. –®–ò–ú —Å —Ä–∞–∑—Ä–µ—à–µ–Ω–∏–µ–º 4095 –∏—Å–ø–æ–ª—å–∑—É–µ—Ç—Å—è –¥–ª—è —É–ø—Ä–∞–≤–ª–µ–Ω–∏—è –º–æ—â–Ω–æ—Å—Ç—å—é –æ—Ö–ª–∞–∂–¥–∞—é—â–µ–≥–æ —É—Å—Ç—Ä–æ–π—Å—Ç–≤–∞, –∞ –ø–∞—Ä–∞–º–µ—Ç—Ä i_max –æ–≥—Ä–∞–Ω–∏—á–∏–≤–∞–µ—Ç –º–∞–∫—Å–∏–º–∞–ª—å–Ω–æ–µ –∑–Ω–∞—á–µ–Ω–∏–µ –∏–Ω—Ç–µ–≥—Ä–∞–ª—å–Ω–æ–π —Å–æ—Å—Ç–∞–≤–ª—è—é—â–µ–π, —á—Ç–æ–±—ã –ø—Ä–µ–¥–æ—Ç–≤—Ä–∞—Ç–∏—Ç—å –ø–µ—Ä–µ—Ä–µ–≥—É–ª–∏—Ä–æ–≤–∞–Ω–∏–µ.

#include <stdio.h>
#include "freertos/FreeRTOS.h"
#include "freertos/task.h"
#include "driver/ledc.h"
#include "esp_err.h"

// –ü–∞—Ä–∞–º–µ—Ç—Ä—ã PID —Ä–µ–≥—É–ª—è—Ç–æ—Ä–∞
float Kp = 1.0f; // –ü—Ä–æ–ø–æ—Ä—Ü–∏–æ–Ω–∞–ª—å–Ω—ã–π –∫–æ—ç—Ñ—Ñ–∏—Ü–∏–µ–Ω—Ç
float Ki = 0.1f; // –ò–Ω—Ç–µ–≥—Ä–∞–ª—å–Ω—ã–π –∫–æ—ç—Ñ—Ñ–∏—Ü–∏–µ–Ω—Ç
float Kd = 0.05f; // –î–∏—Ñ—Ñ–µ—Ä–µ–Ω—Ü–∏–∞–ª—å–Ω—ã–π –∫–æ—ç—Ñ—Ñ–∏—Ü–∏–µ–Ω—Ç
float i_max = 100.0f; // –ú–∞–∫—Å–∏–º–∞–ª—å–Ω–æ–µ –∑–Ω–∞—á–µ–Ω–∏–µ –∏–Ω—Ç–µ–≥—Ä–∞–ª—å–Ω–æ–π —Å–æ—Å—Ç–∞–≤–ª—è—é—â–µ–π

// –ü–µ—Ä–µ–º–µ–Ω–Ω—ã–µ –¥–ª—è —Ö—Ä–∞–Ω–µ–Ω–∏—è –∑–Ω–∞—á–µ–Ω–∏–π
float setpoint = 25.0f; // –ñ–µ–ª–∞–µ–º–∞—è —Ç–µ–º–ø–µ—Ä–∞—Ç—É—Ä–∞
float current_temperature; // –¢–µ–∫—É—â–∞—è —Ç–µ–º–ø–µ—Ä–∞—Ç—É—Ä–∞
float integral = 0.0f; // –ò–Ω—Ç–µ–≥—Ä–∞–ª—å–Ω–∞—è —Å—É–º–º–∞
float previous_error = 0.0f; // –ü—Ä–µ–¥—ã–¥—É—â–∞—è –æ—à–∏–±–∫–∞

// –ù–∞—Å—Ç—Ä–æ–π–∫–∏ –®–ò–ú
#define LEDC_HS_TIMER          LEDC_TIMER_0
#define LEDC_HS_MODE           LEDC_HIGH_SPEED_MODE
#define LEDC_HS_CH0_GPIO       (18) // GPIO –Ω–æ–º–µ—Ä –¥–ª—è –®–ò–ú —Å–∏–≥–Ω–∞–ª–∞
#define LEDC_HS_CH0_CHANNEL    LEDC_CHANNEL_0
#define LEDC_TEST_DUTY         (4095) // –ú–∞–∫—Å–∏–º–∞–ª—å–Ω–æ–µ –∑–Ω–∞—á–µ–Ω–∏–µ –®–ò–ú
#define LEDC_TEST_FADE_TIME    (3000)

// –§—É–Ω–∫—Ü–∏—è –¥–ª—è —á—Ç–µ–Ω–∏—è —Ç–µ–∫—É—â–µ–π —Ç–µ–º–ø–µ—Ä–∞—Ç—É—Ä—ã
float read_temperature() {
    // –ó–¥–µ—Å—å –¥–æ–ª–∂–µ–Ω –±—ã—Ç—å –∫–æ–¥ –¥–ª—è –ø–æ–ª—É—á–µ–Ω–∏—è —Ç–µ–º–ø–µ—Ä–∞—Ç—É—Ä—ã –æ—Ç –¥–∞—Ç—á–∏–∫–∞
    return 0.0f; // –í—Ä–µ–º–µ–Ω–Ω–æ–µ –∑–Ω–∞—á–µ–Ω–∏–µ
}

// –§—É–Ω–∫—Ü–∏—è –¥–ª—è —É–ø—Ä–∞–≤–ª–µ–Ω–∏—è –æ—Ö–ª–∞–∂–¥–µ–Ω–∏–µ–º —Å –∏—Å–ø–æ–ª—å–∑–æ–≤–∞–Ω–∏–µ–º –®–ò–ú
void control_cooling(float output) {
    // –ü—Ä–µ–æ–±—Ä–∞–∑–æ–≤–∞–Ω–∏–µ –≤—ã—Ö–æ–¥–Ω–æ–≥–æ —Å–∏–≥–Ω–∞–ª–∞ PID –≤ –∑–Ω–∞—á–µ–Ω–∏–µ –®–ò–ú
    uint32_t duty = (uint32_t)((output / 100.0f) * LEDC_TEST_DUTY);
    // –û–≥—Ä–∞–Ω–∏—á–µ–Ω–∏–µ –∑–Ω–∞—á–µ–Ω–∏—è –®–ò–ú
    if (duty > LEDC_TEST_DUTY) {
        duty = LEDC_TEST_DUTY;
    }
    // –£—Å—Ç–∞–Ω–æ–≤–∫–∞ –∑–Ω–∞—á–µ–Ω–∏—è –®–ò–ú
    ledc_set_duty(LEDC_HS_MODE, LEDC_HS_CH0_CHANNEL, duty);
    ledc_update_duty(LEDC_HS_MODE, LEDC_HS_CH0_CHANNEL);
}

void pid_task(void *pvParameters) {
    while(1) {
        current_temperature = read_temperature();
        float error = setpoint - current_temperature;
        integral += error * 0.1f; // –ò–Ω—Ç–µ–≥—Ä–∏—Ä–æ–≤–∞–Ω–∏–µ —Å —É—á–µ—Ç–æ–º –≤—Ä–µ–º–µ–Ω–∏ (dt)
        // –û–≥—Ä–∞–Ω–∏—á–µ–Ω–∏–µ –∏–Ω—Ç–µ–≥—Ä–∞–ª—å–Ω–æ–π —Å–æ—Å—Ç–∞–≤–ª—è—é—â–µ–π
        if (integral > i_max) {
            integral = i_max;
        } else if (integral < -i_max) {
            integral = -i_max;
        }
        float derivative = (error - previous_error) / 0.1f; // –î–∏—Ñ—Ñ–µ—Ä–µ–Ω—Ü–∏—Ä–æ–≤–∞–Ω–∏–µ
        float output = Kp * error + Ki * integral + Kd * derivative;
        control_cooling(output);
        previous_error = error;
        vTaskDelay(100 / portTICK_PERIOD_MS); // –ó–∞–¥–µ—Ä–∂–∫–∞ 100 –º—Å
    }
}

void app_main() {
    // –ù–∞—Å—Ç—Ä–æ–π–∫–∞ –®–ò–ú
    ledc_timer_config_t ledc_timer = {
        .duty_resolution = LEDC_TIMER_12_BIT, // –†–∞–∑—Ä–µ—à–µ–Ω–∏–µ 4095
        .freq_hz = 5000,                      // –ß–∞—Å—Ç–æ—Ç–∞ –®–ò–ú
        .speed_mode = LEDC_HS_MODE,           // –†–µ–∂–∏–º –≤—ã—Å–æ–∫–æ–π —Å–∫–æ—Ä–æ—Å—Ç–∏
        .timer_num = LEDC_HS_TIMER            // –¢–∞–π–º–µ—Ä
    };
    ledc_timer_config(&ledc_timer);

    ledc_channel_config_t ledc_channel = {
        .channel    = LEDC_HS_CH0_CHANNEL,
        .duty       = 0,
        .gpio_num   = LEDC_HS_CH0_GPIO,
        .speed_mode = LEDC_HS_MODE,
        .timer_sel  = LEDC_HS_TIMER
    };
    ledc_channel_config(&ledc_channel);

    xTaskCreate(&pid_task, "pid_task", 2048, NULL, 5, NULL);
}

#include <cassert>
#include <cstddef>
#include <string>
#include <utility>
#include <iostream>
#include <vector>
#include <algorithm>

template <typename Type>
class SingleLinkedList {
	// –£–∑–µ–ª —Å–ø–∏—Å–∫–∞
	struct Node {
		Node() = default;
		Node(const Type& val, Node* next)
			: value(val)
			, next_node(next) {
		}
		Type value;
		Node* next_node = nullptr;
	};


	template <typename ValueType>
	class BasicIterator {
		// –ö–ª–∞—Å—Å —Å–ø–∏—Å–∫–∞ –æ–±—ä—è–≤–ª—è–µ—Ç—Å—è –¥—Ä—É–∂–µ—Å—Ç–≤–µ–Ω–Ω—ã–º, —á—Ç–æ–±—ã –∏–∑ –º–µ—Ç–æ–¥–æ–≤ —Å–ø–∏—Å–∫–∞
		// –±—ã–ª –¥–æ—Å—Ç—É–ø –∫ –ø—Ä–∏–≤–∞—Ç–Ω–æ–π –æ–±–ª–∞—Å—Ç–∏ –∏—Ç–µ—Ä–∞—Ç–æ—Ä–∞
		friend class SingleLinkedList;

		// –ö–æ–Ω–≤–µ—Ä—Ç–∏—Ä—É—é—â–∏–π –∫–æ–Ω—Å—Ç—Ä—É–∫—Ç–æ—Ä –∏—Ç–µ—Ä–∞—Ç–æ—Ä–∞ –∏–∑ —É–∫–∞–∑–∞—Ç–µ–ª—è –Ω–∞ —É–∑–µ–ª —Å–ø–∏—Å–∫–∞
		explicit BasicIterator(Node* node) : node_(node) {
		}

	public:
		// –û–±—ä—è–≤–ª–µ–Ω–Ω—ã–µ –Ω–∏–∂–µ —Ç–∏–ø—ã —Å–æ–æ–±—â–∞—é—Ç —Å—Ç–∞–Ω–¥–∞—Ä—Ç–Ω–æ–π –±–∏–±–ª–∏–æ—Ç–µ–∫–µ –æ —Å–≤–æ–π—Å—Ç–≤–∞—Ö —ç—Ç–æ–≥–æ –∏—Ç–µ—Ä–∞—Ç–æ—Ä–∞

		// –ö–∞—Ç–µ–≥–æ—Ä–∏—è –∏—Ç–µ—Ä–∞—Ç–æ—Ä–∞ ‚Äî forward iterator
		// (–∏—Ç–µ—Ä–∞—Ç–æ—Ä, –∫–æ—Ç–æ—Ä—ã–π –ø–æ–¥–¥–µ—Ä–∂–∏–≤–∞–µ—Ç –æ–ø–µ—Ä–∞—Ü–∏–∏ –∏–Ω–∫—Ä–µ–º–µ–Ω—Ç–∞ –∏ –º–Ω–æ–≥–æ–∫—Ä–∞—Ç–Ω–æ–µ —Ä–∞–∑—ã–º–µ–Ω–æ–≤–∞–Ω–∏–µ)
		using iterator_category = std::forward_iterator_tag;
		// –¢–∏–ø —ç–ª–µ–º–µ–Ω—Ç–æ–≤, –ø–æ –∫–æ—Ç–æ—Ä—ã–º –ø–µ—Ä–µ–º–µ—â–∞–µ—Ç—Å—è –∏—Ç–µ—Ä–∞—Ç–æ—Ä
		using value_type = Type;
		// –¢–∏–ø, –∏—Å–ø–æ–ª—å–∑—É–µ–º—ã–π –¥–ª—è —Ö—Ä–∞–Ω–µ–Ω–∏—è —Å–º–µ—â–µ–Ω–∏—è –º–µ–∂–¥—É –∏—Ç–µ—Ä–∞—Ç–æ—Ä–∞–º–∏
		using difference_type = std::ptrdiff_t;
		// –¢–∏–ø —É–∫–∞–∑–∞—Ç–µ–ª—è –Ω–∞ –∏—Ç–µ—Ä–∏—Ä—É–µ–º–æ–µ –∑–Ω–∞—á–µ–Ω–∏–µ
		using pointer = ValueType*;
		// –¢–∏–ø —Å—Å—ã–ª–∫–∏ –Ω–∞ –∏—Ç–µ—Ä–∏—Ä—É–µ–º–æ–µ –∑–Ω–∞—á–µ–Ω–∏–µ
		using reference = ValueType&;

		BasicIterator() = default;

		BasicIterator(const BasicIterator<Type>& other) noexcept {
			node_ = other.node_;
		}

		BasicIterator& operator=(const BasicIterator& rhs) = default;

		[[nodiscard]] bool operator==(const BasicIterator<const Type>& rhs) const noexcept {
			return node_ == rhs.node_;
		}

		[[nodiscard]] bool operator!=(const BasicIterator<const Type>& rhs) const noexcept {
			return !(node_ == rhs.node_);

		}

		[[nodiscard]] bool operator==(const BasicIterator<Type>& rhs) const noexcept {
			return node_ == rhs.node_;
		}

		[[nodiscard]] bool operator!=(const BasicIterator<Type>& rhs) const noexcept {
			return !(node_ == rhs.node_);
		}

		BasicIterator& operator++() noexcept {
			node_ = node_->next_node;
			return *this;
		}

		BasicIterator operator++(int) noexcept {
			auto old_value(*this);
			++(*this);
			return old_value;
		}

		[[nodiscard]] reference operator*() const noexcept {
			return node_->value;
		}

		[[nodiscard]] pointer operator->() const noexcept {
			return &node_->value;
		}

	private:
		Node* node_ = nullptr;
	};

public:

	using value_type = Type;
	using reference = value_type&;
	using const_reference = const value_type&;

	SingleLinkedList() : head_(), size_(0) {};

	~SingleLinkedList() { Clear(); };

	template<typename iterator>
	void Initialization(iterator begin, iterator end)
	{
		Node* newnode = &head_;
		for (auto i = begin; i != end; ++i)
		{
			++size_;
			newnode->next_node = new Node(*i, nullptr);
			newnode = newnode->next_node;
		}
	}

	SingleLinkedList(std::initializer_list<Type> values)
	{
		SingleLinkedList currentlist;
		currentlist.Initialization(values.begin(), values.end());
		swap(currentlist);
	}

	SingleLinkedList(const SingleLinkedList& other)
	{
		SingleLinkedList currentlist;
		currentlist.Initialization(other.begin(), other.end());
		swap(currentlist);
	}

	SingleLinkedList& operator=(const SingleLinkedList& rhs) {
		if (this != &rhs)
		{
			SingleLinkedList currentlist(rhs);
			swap(currentlist);
		}
		return *this;
	}

	// –û–±–º–µ–Ω–∏–≤–∞–µ—Ç —Å–æ–¥–µ—Ä–∂–∏–º–æ–µ —Å–ø–∏—Å–∫–æ–≤ –∑–∞ –≤—Ä–µ–º—è O(1)
	void swap(SingleLinkedList& other) noexcept {
		std::swap(head_.next_node, other.head_.next_node);
		std::swap(size_, other.size_);
	}

	void PushFront(const Type& value) {
		head_.next_node = new Node(value, head_.next_node);
		++size_;
	}

	void Clear() noexcept {
		while (head_.next_node)
		{
			Node* new_node = head_.next_node->next_node;
			delete head_.next_node;
			head_.next_node = new_node;
		}
		size_ = 0;
	}

	[[nodiscard]] size_t GetSize() const noexcept {
		return size_;
	}

	[[nodiscard]] bool IsEmpty() const noexcept {
		return (size_ == 0) ? true : false;
	}

	// –ò—Ç–µ—Ä–∞—Ç–æ—Ä, –¥–æ–ø—É—Å–∫–∞—é—â–∏–π –∏–∑–º–µ–Ω–µ–Ω–∏–µ —ç–ª–µ–º–µ–Ω—Ç–æ–≤ —Å–ø–∏—Å–∫–∞
	using Iterator = BasicIterator<Type>;
	// –ö–æ–Ω—Å—Ç–∞–Ω—Ç–Ω—ã–π –∏—Ç–µ—Ä–∞—Ç–æ—Ä, –ø—Ä–µ–¥–æ—Å—Ç–∞–≤–ª—è—é—â–∏–π –¥–æ—Å—Ç—É–ø –¥–ª—è —á—Ç–µ–Ω–∏—è –∫ —ç–ª–µ–º–µ–Ω—Ç–∞–º —Å–ø–∏—Å–∫–∞
	using ConstIterator = BasicIterator<const Type>;

	[[nodiscard]] Iterator begin() noexcept {
		return Iterator{ head_.next_node };
	}

	[[nodiscard]] Iterator end() noexcept {
		return Iterator{ nullptr };
	}

	[[nodiscard]] ConstIterator begin() const noexcept {
		return ConstIterator{ head_.next_node };
	}

	[[nodiscard]] ConstIterator end() const noexcept {
		return ConstIterator{ nullptr };
	}

	[[nodiscard]] ConstIterator cbegin() const noexcept {
		return ConstIterator{ head_.next_node };
	}

	[[nodiscard]] ConstIterator cend() const noexcept {
		return ConstIterator{ nullptr };
	}

	// –í–æ–∑–≤—Ä–∞—â–∞–µ—Ç –∏—Ç–µ—Ä–∞—Ç–æ—Ä, —É–∫–∞–∑—ã–≤–∞—é—â–∏–π –Ω–∞ –ø–æ–∑–∏—Ü–∏—é –ø–µ—Ä–µ–¥ –ø–µ—Ä–≤—ã–º —ç–ª–µ–º–µ–Ω—Ç–æ–º –æ–¥–Ω–æ—Å–≤—è–∑–Ω–æ–≥–æ —Å–ø–∏—Å–∫–∞.
	// –†–∞–∑—ã–º–µ–Ω–æ–≤—ã–≤–∞—Ç—å —ç—Ç–æ—Ç –∏—Ç–µ—Ä–∞—Ç–æ—Ä –Ω–µ–ª—å–∑—è - –ø–æ–ø—ã—Ç–∫–∞ —Ä–∞–∑—ã–º–µ–Ω–æ–≤–∞–Ω–∏—è –ø—Ä–∏–≤–µ–¥—ë—Ç –∫ –Ω–µ–æ–ø—Ä–µ–¥–µ–ª—ë–Ω–Ω–æ–º—É –ø–æ–≤–µ–¥–µ–Ω–∏—é
	[[nodiscard]] Iterator before_begin() noexcept {
		return Iterator{ &head_ };
	}

	// –í–æ–∑–≤—Ä–∞—â–∞–µ—Ç –∫–æ–Ω—Å—Ç–∞–Ω—Ç–Ω—ã–π –∏—Ç–µ—Ä–∞—Ç–æ—Ä, —É–∫–∞–∑—ã–≤–∞—é—â–∏–π –Ω–∞ –ø–æ–∑–∏—Ü–∏—é –ø–µ—Ä–µ–¥ –ø–µ—Ä–≤—ã–º —ç–ª–µ–º–µ–Ω—Ç–æ–º –æ–¥–Ω–æ—Å–≤—è–∑–Ω–æ–≥–æ —Å–ø–∏—Å–∫–∞.
	// –†–∞–∑—ã–º–µ–Ω–æ–≤—ã–≤–∞—Ç—å —ç—Ç–æ—Ç –∏—Ç–µ—Ä–∞—Ç–æ—Ä –Ω–µ–ª—å–∑—è - –ø–æ–ø—ã—Ç–∫–∞ —Ä–∞–∑—ã–º–µ–Ω–æ–≤–∞–Ω–∏—è –ø—Ä–∏–≤–µ–¥—ë—Ç –∫ –Ω–µ–æ–ø—Ä–µ–¥–µ–ª—ë–Ω–Ω–æ–º—É –ø–æ–≤–µ–¥–µ–Ω–∏—é
	[[nodiscard]] ConstIterator cbefore_begin() const noexcept {
		return ConstIterator{ const_cast<Node*>(&head_) };
	}

	// –í–æ–∑–≤—Ä–∞—â–∞–µ—Ç –∫–æ–Ω—Å—Ç–∞–Ω—Ç–Ω—ã–π –∏—Ç–µ—Ä–∞—Ç–æ—Ä, —É–∫–∞–∑—ã–≤–∞—é—â–∏–π –Ω–∞ –ø–æ–∑–∏—Ü–∏—é –ø–µ—Ä–µ–¥ –ø–µ—Ä–≤—ã–º —ç–ª–µ–º–µ–Ω—Ç–æ–º –æ–¥–Ω–æ—Å–≤—è–∑–Ω–æ–≥–æ —Å–ø–∏—Å–∫–∞.
	// –†–∞–∑—ã–º–µ–Ω–æ–≤—ã–≤–∞—Ç—å —ç—Ç–æ—Ç –∏—Ç–µ—Ä–∞—Ç–æ—Ä –Ω–µ–ª—å–∑—è - –ø–æ–ø—ã—Ç–∫–∞ —Ä–∞–∑—ã–º–µ–Ω–æ–≤–∞–Ω–∏—è –ø—Ä–∏–≤–µ–¥—ë—Ç –∫ –Ω–µ–æ–ø—Ä–µ–¥–µ–ª—ë–Ω–Ω–æ–º—É –ø–æ–≤–µ–¥–µ–Ω–∏—é
	[[nodiscard]] ConstIterator before_begin() const noexcept {
		return ConstIterator{ const_cast<Node*>(&head_) };
	}

	/*
	 * –í—Å—Ç–∞–≤–ª—è–µ—Ç —ç–ª–µ–º–µ–Ω—Ç value –ø–æ—Å–ª–µ —ç–ª–µ–º–µ–Ω—Ç–∞, –Ω–∞ –∫–æ—Ç–æ—Ä—ã–π —É–∫–∞–∑—ã–≤–∞–µ—Ç pos.
	 * –í–æ–∑–≤—Ä–∞—â–∞–µ—Ç –∏—Ç–µ—Ä–∞—Ç–æ—Ä –Ω–∞ –≤—Å—Ç–∞–≤–ª–µ–Ω–Ω—ã–π —ç–ª–µ–º–µ–Ω—Ç
	 * –ï—Å–ª–∏ –ø—Ä–∏ —Å–æ–∑–¥–∞–Ω–∏–∏ —ç–ª–µ–º–µ–Ω—Ç–∞ –±—É–¥–µ—Ç –≤—ã–±—Ä–æ—à–µ–Ω–æ –∏—Å–∫–ª—é—á–µ–Ω–∏–µ, —Å–ø–∏—Å–æ–∫ –æ—Å—Ç–∞–Ω–µ—Ç—Å—è –≤ –ø—Ä–µ–∂–Ω–µ–º —Å–æ—Å—Ç–æ—è–Ω–∏–∏
	 */
	Iterator InsertAfter(ConstIterator pos, const Type& value) {
        Node* new_node = pos.node_->next_node;
        pos.node_->next_node = new Node(value, new_node);
        ++size_;
        return Iterator{ pos.node_->next_node }; // –∏—Å–ø—Ä–∞–≤–∏–ª, –±—ã–ª–æ pos.node_
    }

	void PopFront() noexcept {
		if (!IsEmpty())
		{
			Node* current_node = head_.next_node->next_node;
			delete head_.next_node;
			--size_;
			head_.next_node = current_node;
		}
	}

	/*
	 * –£–¥–∞–ª—è–µ—Ç —ç–ª–µ–º–µ–Ω—Ç, —Å–ª–µ–¥—É—é—â–∏–π –∑–∞ pos.
	 * –í–æ–∑–≤—Ä–∞—â–∞–µ—Ç –∏—Ç–µ—Ä–∞—Ç–æ—Ä –Ω–∞ —ç–ª–µ–º–µ–Ω—Ç, —Å–ª–µ–¥—É—é—â–∏–π –∑–∞ —É–¥–∞–ª—ë–Ω–Ω—ã–º
	 */
	Iterator EraseAfter(ConstIterator pos) noexcept {
	if (!IsEmpty())
	{
		Node* helper = pos.node_->next_node->next_node;
		delete pos.node_->next_node;
		--size_;
		pos.node_->next_node = helper;
	}
	

	return Iterator{ pos.node_->next_node };
}

private:
	Node head_;
	size_t size_ = 0;
};

template <typename Type>
void swap(SingleLinkedList<Type>& lhs, SingleLinkedList<Type>& rhs) noexcept {
	lhs.swap(rhs);
}

template <typename Type>
bool operator==(const SingleLinkedList<Type>& lhs, const SingleLinkedList<Type>& rhs) {
	return std::equal(lhs.begin(), lhs.end(), rhs.begin(), rhs.end());
}

template <typename Type>
bool operator!=(const SingleLinkedList<Type>& lhs, const SingleLinkedList<Type>& rhs) {
	return !(lhs == rhs);
}

template <typename Type>
bool operator<(const SingleLinkedList<Type>& lhs, const SingleLinkedList<Type>& rhs) {
	return std::lexicographical_compare(lhs.begin(), lhs.end(), rhs.begin(), rhs.end());
}

template <typename Type>
bool operator<=(const SingleLinkedList<Type>& lhs, const SingleLinkedList<Type>& rhs) {
	return (lhs < rhs) || (lhs == rhs);
}

template <typename Type>
bool operator>(const SingleLinkedList<Type>& lhs, const SingleLinkedList<Type>& rhs) {
	return !(lhs < rhs);
}

template <typename Type>
bool operator>=(const SingleLinkedList<Type>& lhs, const SingleLinkedList<Type>& rhs) {
	return (lhs > rhs) || (lhs == rhs);
}

// –≠—Ç–∞ —Ñ—É–Ω–∫—Ü–∏—è –ø—Ä–æ–≤–µ—Ä—è–µ—Ç —Ä–∞–±–æ—Ç—É –∫–ª–∞—Å—Å–∞ SingleLinkedList
void Test4() {
	struct DeletionSpy {
		~DeletionSpy() {
			if (deletion_counter_ptr) {
				++(*deletion_counter_ptr);
			}
		}
		int* deletion_counter_ptr = nullptr;
	};

	// –ü—Ä–æ–≤–µ—Ä–∫–∞ PopFront
	{
		SingleLinkedList<int> numbers{ 3, 14, 15, 92, 6 };
		numbers.PopFront();
		assert((numbers == SingleLinkedList<int>{14, 15, 92, 6}));

		SingleLinkedList<DeletionSpy> list;
		list.PushFront(DeletionSpy{});
		int deletion_counter = 0;
		list.begin()->deletion_counter_ptr = &deletion_counter;
		assert(deletion_counter == 0);
		list.PopFront();
		assert(deletion_counter == 1);
	}

	// –î–æ—Å—Ç—É–ø –∫ –ø–æ–∑–∏—Ü–∏–∏, –ø—Ä–µ–¥—à–µ—Å—Ç–≤—É—é—â–µ–π begin
	{
		SingleLinkedList<int> empty_list;
		const auto& const_empty_list = empty_list;
		assert(empty_list.before_begin() == empty_list.cbefore_begin());
		assert(++empty_list.before_begin() == empty_list.begin());
		assert(++empty_list.cbefore_begin() == const_empty_list.begin());

		SingleLinkedList<int> numbers{ 1, 2, 3, 4 };
		const auto& const_numbers = numbers;
		assert(numbers.before_begin() == numbers.cbefore_begin());
		assert(++numbers.before_begin() == numbers.begin());
		assert(++numbers.cbefore_begin() == const_numbers.begin());
	}

	// –í—Å—Ç–∞–≤–∫–∞ —ç–ª–µ–º–µ–Ω—Ç–∞ –ø–æ—Å–ª–µ —É–∫–∞–∑–∞–Ω–Ω–æ–π –ø–æ–∑–∏—Ü–∏–∏
	{  // –í—Å—Ç–∞–≤–∫–∞ –≤ –ø—É—Å—Ç–æ–π —Å–ø–∏—Å–æ–∫
		{
			SingleLinkedList<int> lst;
			const auto inserted_item_pos = lst.InsertAfter(lst.before_begin(), 123);
			assert((lst == SingleLinkedList<int>{123}));
			assert(inserted_item_pos == lst.begin());
			assert(*inserted_item_pos == 123);
		}

		// –í—Å—Ç–∞–≤–∫–∞ –≤ –Ω–µ–ø—É—Å—Ç–æ–π —Å–ø–∏—Å–æ–∫
		{
			SingleLinkedList<int> lst{ 1, 2, 3 };
			auto inserted_item_pos = lst.InsertAfter(lst.before_begin(), 123);

			assert(inserted_item_pos == lst.begin());
			assert(inserted_item_pos != lst.end());
			assert(*inserted_item_pos == 123);
			assert((lst == SingleLinkedList<int>{123, 1, 2, 3}));

			inserted_item_pos = lst.InsertAfter(lst.begin(), 555);
			assert(++SingleLinkedList<int>::Iterator(lst.begin()) == inserted_item_pos);
			assert(*inserted_item_pos == 555);
			assert((lst == SingleLinkedList<int>{123, 555, 1, 2, 3}));
		};
	}

	// –í—Å–ø–æ–º–æ–≥–∞—Ç–µ–ª—å–Ω—ã–π –∫–ª–∞—Å—Å, –±—Ä–æ—Å–∞—é—â–∏–π –∏—Å–∫–ª—é—á–µ–Ω–∏–µ –ø–æ—Å–ª–µ —Å–æ–∑–¥–∞–Ω–∏—è N-–∫–æ–ø–∏–∏
	struct ThrowOnCopy {
		ThrowOnCopy() = default;
		explicit ThrowOnCopy(int& copy_counter) noexcept
			: countdown_ptr(&copy_counter) {
		}
		ThrowOnCopy(const ThrowOnCopy& other)
			: countdown_ptr(other.countdown_ptr)  //
		{
			if (countdown_ptr) {
				if (*countdown_ptr == 0) {
					throw std::bad_alloc();
				}
				else {
					--(*countdown_ptr);
				}
			}
		}
		// –ü—Ä–∏—Å–≤–∞–∏–≤–∞–Ω–∏–µ —ç–ª–µ–º–µ–Ω—Ç–æ–≤ —ç—Ç–æ–≥–æ —Ç–∏–ø–∞ –Ω–µ —Ç—Ä–µ–±—É–µ—Ç—Å—è
		ThrowOnCopy& operator=(const ThrowOnCopy& rhs) = delete;
		// –ê–¥—Ä–µ—Å —Å—á—ë—Ç—á–∏–∫–∞ –æ–±—Ä–∞—Ç–Ω–æ–≥–æ –æ—Ç—Å—á—ë—Ç–∞. –ï—Å–ª–∏ –Ω–µ —Ä–∞–≤–µ–Ω nullptr, —Ç–æ —É–º–µ–Ω—å—à–∞–µ—Ç—Å—è –ø—Ä–∏ –∫–∞–∂–¥–æ–º –∫–æ–ø–∏—Ä–æ–≤–∞–Ω–∏–∏.
		// –ö–∞–∫ —Ç–æ–ª—å–∫–æ –æ–±–Ω—É–ª–∏—Ç—Å—è, –∫–æ–Ω—Å—Ç—Ä—É–∫—Ç–æ—Ä –∫–æ–ø–∏—Ä–æ–≤–∞–Ω–∏—è –≤—ã–±—Ä–æ—Å–∏—Ç –∏—Å–∫–ª—é—á–µ–Ω–∏–µ
		int* countdown_ptr = nullptr;
	};

	// –ü—Ä–æ–≤–µ—Ä–∫–∞ –æ–±–µ—Å–ø–µ—á–µ–Ω–∏—è —Å—Ç—Ä–æ–≥–æ–π –≥–∞—Ä–∞–Ω—Ç–∏–∏ –±–µ–∑–æ–ø–∞—Å–Ω–æ—Å—Ç–∏ –∏—Å–∫–ª—é—á–µ–Ω–∏–π
	{
		bool exception_was_thrown = false;
		for (int max_copy_counter = 10; max_copy_counter >= 0; --max_copy_counter) {
			SingleLinkedList<ThrowOnCopy> list{ ThrowOnCopy{}, ThrowOnCopy{}, ThrowOnCopy{} };
			try {
				int copy_counter = max_copy_counter;
				list.InsertAfter(list.cbegin(), ThrowOnCopy(copy_counter));
				assert(list.GetSize() == 4u);
			}
			catch (const std::bad_alloc&) {
				exception_was_thrown = true;
				assert(list.GetSize() == 3u);
				break;
			}
		}
		assert(exception_was_thrown);
	}

	// –£–¥–∞–ª–µ–Ω–∏–µ —ç–ª–µ–º–µ–Ω—Ç–æ–≤ –ø–æ—Å–ª–µ —É–∫–∞–∑–∞–Ω–Ω–æ–π –ø–æ–∑–∏—Ü–∏–∏
	{
		{
			SingleLinkedList<int> lst{ 1, 2, 3, 4 };
			const auto& const_lst = lst;
			const auto item_after_erased = lst.EraseAfter(const_lst.cbefore_begin());
			assert((lst == SingleLinkedList<int>{2, 3, 4}));
			assert(item_after_erased == lst.begin());
		}
		{
			SingleLinkedList<int> lst{ 1, 2, 3, 4 };
			const auto item_after_erased = lst.EraseAfter(lst.cbegin());
			assert((lst == SingleLinkedList<int>{1, 3, 4}));
			assert(item_after_erased == (++lst.begin()));
		}
		{
			SingleLinkedList<int> lst{ 1, 2, 3, 4 };
			const auto item_after_erased = lst.EraseAfter(++(++lst.cbegin()));
			assert((lst == SingleLinkedList<int>{1, 2, 3}));
			assert(item_after_erased == lst.end());
		}
		{
			SingleLinkedList<DeletionSpy> list{ DeletionSpy{}, DeletionSpy{}, DeletionSpy{} };
			auto after_begin = ++list.begin();
			int deletion_counter = 0;
			after_begin->deletion_counter_ptr = &deletion_counter;
			assert(deletion_counter == 0u);
			list.EraseAfter(list.cbegin());
			assert(deletion_counter == 1u);
		}
	}
}

int main() {
	Test4();
}

from _collections import deque

green_light = int(input())
free_window = int(input())

cars = deque()
cars_counter = 0
crashed = False

command = input()
while command != "END":
    if command == "green":
        current_car = cars.popleft() if cars else None
        left_seconds = green_light - len(current_car) if current_car else 0

        while cars and left_seconds > 0:
            current_car = cars.popleft()
            cars_counter += 1
            left_seconds -= len(current_car)

        if left_seconds == 0 and current_car:
            cars_counter += 1
        if free_window >= abs(left_seconds) and current_car:
            if left_seconds < 0:
                cars_counter += 1
        else:
            index = free_window + left_seconds
            print(f"A crash happened!\n{current_car} was hit at {current_car[index]}.")
            crashed = True
            break
    else:
        cars.append(command)
    command = input()

if not crashed:
    print(f"Everyone is safe.\n{cars_counter} total cars passed the crossroads.")

