namespace HomeWork
{
    internal class Program
    {
        static void Main(string[] args)
        {
            Random random = new Random();
            int arrayLenght = 15;
            int[] arrayNumbers = new int[arrayLenght];
            FillArray(arrayNumbers, random);
            Console.Write("–ò—Å—Ö–æ–¥–Ω—ã–π –º–∞—Å—Å–∏–≤ —á–∏—Å–ª–µ–ª: ");
            OutputArray(arrayNumbers);
            Console.Write("\n\n–ü–µ—Ä–µ–º–µ—à–∞–Ω–Ω—ã–π –º–∞—Å—Å–∏–≤ —á–∏—Å–ª–µ–ª: ");
            Shuffle(arrayNumbers, random);
            OutputArray(arrayNumbers);
        }

        static void FillArray(int[] arrayNumbers, Random random) 
        {
            int minNumbers = 0;
            int maxNumbers = 10;

            for (int i = 0; i < arrayNumbers.Length; i++)
            {
                arrayNumbers[i] = random.Next(minNumbers, maxNumbers);
            }
        }

        static void OutputArray(int[] arrayNumerOutput)
        {
            for (int i = 0; i < arrayNumerOutput.Length; i++)
            {
                Console.Write(arrayNumerOutput[i] + "|");
            }
        }

        static void Shuffle(int[] arrayNumberShuffle, Random random)
        {
            int shuffledElement;
            int randomIndex;

            for (int i = 0; i < arrayNumberShuffle.Length; i++)
            {
                randomIndex = random.Next(arrayNumberShuffle.Length);
                shuffledElement = arrayNumberShuffle[randomIndex];
                arrayNumberShuffle[randomIndex] = arrayNumberShuffle[i];
                arrayNumberShuffle[i] = shuffledElement;
            }
        }
    }
}

using System;

namespace CSLight
{
    internal class Program
    {
        static void Main(string[] args)
        {
            Random random = new Random();
            int minValue = 0;
            int maxValue = 10;

            int[] numbers = new int[30];
            int mostRepeatableNumber = 0;
            int repeats = 0;
            bool isSeveralNumbersRepeats = false;

            for (int i = 0; i < numbers.Length; i++)
            {
                numbers[i] = random.Next(minValue, maxValue + 1);
            }

            Console.WriteLine("–ß–∏—Å–ª–∞ –≤ –º–∞—Å—Å–∏–≤–µ:");

            for (int i = 0; i < numbers.Length; i++)
            {
                Console.Write(numbers[i] + " ");
            }

            int tempRepeats = 0;

            for (int i = 0; i < numbers.Length - 1; i++)
            {
                if (numbers[i] == numbers[i + 1])
                {
                    tempRepeats++;
                }
                else
                {
                    if (tempRepeats > repeats)
                    {
                        repeats = tempRepeats;
                        mostRepeatableNumber = numbers[i];
                        tempRepeats = 0;
                        isSeveralNumbersRepeats = false;
                    } 
                    else if (tempRepeats == repeats)
                    {
                        isSeveralNumbersRepeats = true;
                    }
                }
            }

            if (isSeveralNumbersRepeats)
            {
                Console.WriteLine("–ù–µ—Å–∫–æ–ª—å–∫–æ —Ä–∞–∑–Ω—ã—Ö —á–∏—Å–µ–ª –ø–æ–≤—Ç–æ—Ä—è–µ—Ç—Å—è –æ–¥–∏–Ω–∞–∫–æ–≤–æ–µ –∫–æ–ª-–≤–æ —Ä–∞–∑");
            }
            else
            {
                Console.WriteLine($"–ß–∏—Å–ª–æ {mostRepeatableNumber} –ø–æ–≤—Ç–æ—Ä—è–µ—Ç—Å—è {repeats} —Ä–∞–∑.");
            }
           
            Console.ReadLine();
        }
    }
}

